 (page: Page): string => {
  const pageId = uuidv4();
  const allPages = browserSessionsCache.get("pages");
  if (allPages) {
    browserSessionsCache.set("pages", { ...allPages, [pageId]: page });
  } else {
    browserSessionsCache.set("pages", { [pageId]: page });
  }
  return pageId;
}
